import React from "react"

function Attraction({type, name, notes, visited}){
    return(
        <tr>
        <td>{attraction.type}</td>
        <td>{attraction.notes}</td>
        <td>{attraction.name}</td>
        <td>{attraction.visited}</td>
      </tr>
    )
}

export default Attraction
